import './index.css';

export default function SelectedInput({selection, val, onInputChange}) {
  if (selection === 1) {
    return (
      <div className="input-selection-button">
        <h2>Weight 1</h2>
        <input type="number" value={val} name="weight" placeholder="Your current weigth" 
        onChange={e => onInputChange(e.target.value)}/>
      </div>
    );     
  }

  if (selection === 2) {
    return (
      <div className="input-selection-button">
        <h2>Bench press 2</h2>
        <input type="number" value={val.w} name="bench-weight" placeholder="Weight" 
        onChange={e => onInputChange({...val, w: e.target.value})}/>
        <input type="number" value={val.r} name="bench-reps" placeholder="Reps" 
        onChange={e => onInputChange({...val, r: e.target.value})}/>
      </div>
    );     
  }

  if (selection === 3) {
    return (
      <div className="input-selection-button">
        <h2>Squat 3</h2>
        <input type="number" name="squat-weight" placeholder="Weight" />
        <input type="number" name="squat-reps" placeholder="Reps" />
      </div>
    );     
  }

  if (selection === 4) {
    return (
      <div className="input-selection-button">
        <h2>Dead lift 4</h2>
        <input type="number" name="deadlift-weight" placeholder="Weight" />
        <input type="number" name="deadlift-reps" placeholder="Reps" />
      </div>
    );     
  }
    return (
      <div className="input-selection-button">
        <h2>Pullups 5</h2>
        <input type="number" name="pullup-reps" placeholder="Reps" />
      </div>
    );     
}
